class User:
    def __init__(self, user_id, user_type):
        self.user_id = user_id
        self.user_type = user_type

class Developer(User):
    def log_issue(self, issue):
        print(f"Logging issue: {issue}")

    def update_validation_rule(self, rule_id):
        print(f"Updating validation rule for rule ID: {rule_id}")

    def cache_d_file_requests(self):
        print("Managing and caching D Files generation requests.")

class UIUser(User):
    def report_user_testing(self, report):
        print(f"Reporting user testing results: {report}")

    def begin_user_testing(self):
        print("Beginning user testing.")

    def redesign_resources_page(self):
        print("Redesigning Resources page to match new styles.")

class DataUser(User):
    def process_deletions(self, date):
        print(f"Processing deletions for date: {date}")

    def access_fpds_data(self):
        print("Accessing FPDS data.")

class AgencyUser(User):
    def include_flexfields(self):
        print("Including a large number of flexfields without performance impact.")

class FABSUser(User):
    def submit_data(self, data):
        print(f"Submitting data: {data}")

    def download_uploaded_fabs_file(self):
        print("Downloading the uploaded FABS file.")

class BrokerUser(User):
    def upload_and_validate(self):
        print("Uploading and validating the error message.")

    def generate_d1_file(self):
        print("Generating D1 file synced with FPDS data load.")

class System:
    def __init__(self):
        self.users = []
        self.logs = []

    def add_user(self, user):
        self.users.append(user)

    def log_action(self, action):
        self.logs.append(action)
        print(f"Action logged: {action}")

    def process_deletions(self, date):
        for user in self.users:
            if isinstance(user, DataUser):
                user.process_deletions(date)

    def redesign_resources_page(self):
        for user in self.users:
            if isinstance(user, UIUser):
                user.redesign_resources_page()

    def begin_user_testing(self):
        for user in self.users:
            if isinstance(user, UIUser):
                user.begin_user_testing()

# Example Usage
system = System()

data_user = DataUser(user_id=1, user_type="Data")
ui_user = UIUser(user_id=2, user_type="UI")
developer = Developer(user_id=3, user_type="Developer")
agency_user = AgencyUser(user_id=4, user_type="Agency")
fabs_user = FABSUser(user_id=5, user_type="FABS")
broker_user = BrokerUser(user_id=6, user_type="Broker")

system.add_user(data_user)
system.add_user(ui_user)
system.add_user(developer)
system.add_user(agency_user)
system.add_user(fabs_user)
system.add_user(broker_user)

# Implementing user stories
system.process_deletions("12-19-2017")
system.redesign_resources_page()
system.begin_user_testing()
